import React, { useEffect } from "react";
import LoginContainer from "../login/LoginContainer";

const login = async (authenticationToken: string) => {
  await fetch("http://localhost:5000/login", {
    method: "GET",
    // mode: "no-cors",
    headers: {
      "Content-Type": "application/x-www-form-urlencoded",
      Authorization: `Bearer eyJ0eXAiOiJKV1QiLCJhbGciOiJSUzI1NiIsImtpZCI6IlJEWkROVVEyTnpoQk5VVkNRa001T0RSQk5UaEROamhGTURJMVFqazVRVUk0TkRreVJVWXlPUSJ9..GoPXrWf6KFh0QfllapZB3cVt9wYwqUoVcmfDuA-tv4A5YoCy_e1GUk2bO74P64T2igO9luXI5SLI00TWr-0cBdVEHxZpUBv4YzDyDixufpSxpmgwnp6kj6ZypPvFqYnsASCSjEkPAm4duwaoMt7EUF0OxjGVRMfZZODk-aq4BHAtq4oAV2tKA-kUps3-xCznpyfdXrkJiTa2xRevssEPr0VBP9JyPoeg8fa7MayhN0W8zkJ1-pj4cAfqU5mEf3Lb6qV_y3oaM2QSeekpWOlcMUb6q97vuVw4fqx37iT8rDlRaaIAorFcdgWDv4PhgyfagPh9UtcBrKFvTXgb4KZ1jw`
    }
  });
};

const DashboardContainer = ({ auth }: any) => {
  useEffect(() => {
    console.log("auth", auth);
    console.log("auth", auth.getAccessToken());
    console.log("auth", auth.getIdToken());
    console.log("auth", auth.isAuthenticated());
    if (auth && auth.getAccessToken()) {
      login(auth.getIdToken());
    }
  });

  return (
    <div>
      <LoginContainer auth={auth} />
      <div>Dashboard</div>
    </div>
  );
};

export default DashboardContainer;
